import React from 'react';
import './App.css';
const e = React.createElement;
function App() {
  return (
    e('div',{className:'container'},
      e('div',{className:'console'},
        e('textarea',{},'dsadsad')
      ),
      e('div',{},'console'),
      e('div',{},'admin-panel'),
    )
  );
}

export default App;
